import React, { Component } from "react";
import { Button, AppBar, Input, Container, Avatar } from "@material-ui/core";
import logo from "../images/6pm-Logo-1x._V285053994_.png";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  avatar: {
    margin: 10
  },
  bigAvatar: {
    margin: 30,
    width: 60,
    height: 60
  }
});

class Header extends Component {
  render() {
    return (
      <div>
        <AppBar position="static" color="inherit">
          <Avatar src={logo} className={useStyles.bigAvatar} />
          <Button fullWidth="false" color="default">
            Home
          </Button>
          <Button fullWidth="false">Contact</Button>
          <Button fullWidth="false">About</Button>
        </AppBar>
        <Container>
          <Button variant="contained" color="primary">
            Hello World
          </Button>
          <Input fullWidth="true" />
        </Container>
      </div>
    );
  }
}

export default Header;
